  return (
    <div className='App'>
      {/* to send data across props */}
      <Headr name={name} />
      <div className='main'>
        {/* to send data across props */}
        <Sidbar name={name} />
        <Form setName={setName} setEmail={setEmail} />
      </div>
    </div>
  )
}

export default App
